	('ebcf988e-de62-4455-8706-1199ab3a9d87', 'The Little Mermaid', 'Based on the 1989 Disney animated film, and the fairy tale by Hans Christian Andersen, a mermaid dreams of the world above the sea and gives up her voice to find true love. The magical underwater world of The Little Mermaid musical enchants audiences with beloved classics like "Part of Your World" and "Under the Sea," those timeless treasures that transport us back to our first journey beneath the waves.', '2025-08-20', NULL, '20:00:00', '22:15:00', '3e7f2a79-d5e8-4a0c-b155-072cf339ea13', 'ec374569-7a4c-4fb7-9374-1abcd6bfa620', NULL, 'https://leavenworthsummertheater.org/som', 'https://app.arts-people.com/index.php?ticketing=lvst', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://images.squarespace-cdn.com/content/v1/5f6ba16e63f3867a847921d4/2159f954-4daf-4d5c-a2ef-c9adc72b9d6c/LST+Mermaid.JPG?format=750w', false, NULL, false, true, '$14-40', 'approved', NULL, '2025-07-24 22:04:02.784739+00', '2025-07-24 22:07:34.851408+00', NULL, NULL, 'Turquoise waves with the writing Disney''s The Little Mermaid'),
	('d3a05281-71bf-4cac-9418-7b24f0c790fe', 'Make a Scrabble Tile Coaster', 'Kids in grades K-5 are invited for weekly summer fun at the library. This year''s theme is "Level Up at your Library," so get ready for some book-related games to boost kids'' engagement with books, along with the usual crafts and STEM activities.  \r\n\r\nChildren will be divided into two age groups for art/STEM activities. Children requiring continual one-on-one assistance should be accompanied by an adult.', '2025-07-23', NULL, '13:00:00', '15:00:00', '3ca6bebf-33b1-4265-b280-fb6dd9ebda6a', 'd0d913fe-92fe-4838-b5da-50d5479edfee', NULL, 'https://ncwlibraries.libcal.com/event/14596611', NULL, 'a20ee91d-6c87-46c5-92b5-869c569e6012', NULL, NULL, NULL, false, NULL, false, false, NULL, 'approved', NULL, '2025-07-16 19:36:29.200238+00', '2025-07-23 03:43:36.232761+00', NULL, NULL, NULL),
