	('24b72f7a-5729-465f-bbad-536a5732133d', 'Yotes @ Ski Hill', 'Yotes combines his rich baritone vocals with an energetic delivery, playing a mix of songs from 1950s country, 1980s neo rockabilly, modern Americana, and many genres and eras in between. He mixes songs by Johnny Cash, The Stray Cats, The Blasters, and Murder By Death with his own compositions. Old favorites are interspersed with some of his favorite songs by friends and up-and-coming artists hes met through the years.', '2025-07-23', NULL, '19:00:00', '21:00:00', '8d8163ad-736c-4ab9-96ef-a3d50a0e8858', '2e6993f7-4dc9-458b-a81f-2f2eab6c15dd', NULL, NULL, NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', 'a20ee91d-6c87-46c5-92b5-869c569e6012', NULL, NULL, false, '2d495bbd-6691-49ff-a03a-883d1e4de929', false, false, NULL, 'approved', NULL, '2025-07-16 19:35:33.188864+00', '2025-07-16 22:59:25.865338+00', NULL, NULL, NULL),
