	('682bbd8e-d546-4531-ba6f-a6ab3fa23dd8', 'Ski Hill Fall Music Festival', 'Come up to Ski Hill on September 6th as we celebrate the end of Summer with local Live Music with Buzz Brump, Dance party with Abe Martinez, food and drinks!

All proceeds from this community event benefit Leavenworth Sports Club!  Help us raise funds to continue our mission and promote health, fitness and fun through skiing and other winter sports by providing quality facilities, education, and activities to the community! 
 
Music Lineup
5:30-7:30- Buzz Brump 
8:00pm-10pm - Abe Martinez glow dance party with lasers!


