	('f1072538-515e-4cab-a605-90fdd0cae6fc', 'Birding by the River', 'Go birding with staff from the Wenatchee River Institute at our campus by the Wenatchee River! All birding skill levels are welcome.  We have loaner binoculars that you can borrow.

