	('a85266d8-3caa-448e-8ee2-42f8e46639a8', 'Outdoor Film: Wayne''s World', 'Waynes World is a 1992 cult-classic comedy based on a popular Saturday Night Live sketch, featuring iconic characters, memorable catchphrases, and a soundtrack that sparked a resurgence of interest in classic rock music. Rated PG-13.', '2025-08-07', NULL, '20:15:00', '22:00:00', '6e0b075a-c369-477d-8804-d09f175f7f99', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000A54tF2AR', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000A54tF2AR', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/WW-Outdoor-Movie-with-logo.jpg', false, 'cfbc5d07-0adb-4082-a69f-f0516a62516d', false, false, '$5-8', 'archived', NULL, '2025-07-24 20:25:40.031912+00', '2025-08-27 14:02:57.705401+00', NULL, NULL, 'Wayne and Garth, two men, one wearing a hat that says Waynes World.'),
	('f2aa5399-5612-49c3-9c38-2111ebc51587', 'Kairos w/ Stephen Beus', 'Experience the transformative power of chamber music with Kairos, the esteemed ensemble-in-residence at Central Washington University.', '2025-08-03', NULL, '14:00:00', '16:00:00', 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH000009931V2AQ', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH000009931V2AQ', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/Kairos-final-.jpg', false, NULL, false, true, '$10-25', 'approved', NULL, '2025-07-24 21:31:15.28741+00', '2025-07-24 21:31:15.28741+00', NULL, NULL, ''),
	('8cba577e-74fd-469c-baf1-271b90c1be55', 'Third-Seven', 'Third Seven, the solo project of multi-instrumentalist and composer Billy Mickelson, is returning to the stage for a performance unlike anything you''ve heard before. With a foundation in classical cello and a spirit rooted in fearless experimentation, Mickelson uses live looping, percussion, and haunting vocals to create sonic landscapes that defy genre and expectation.', '2025-08-02', NULL, '19:00:00', '21:00:00', '06534828-ce3b-430e-a56e-33c0ef903bf6', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000990IA2AY', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000990IA2AY', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/ThirdSeven.png', false, NULL, false, true, '$10-25', 'approved', NULL, '2025-07-24 21:33:06.470445+00', '2025-07-24 21:33:06.470445+00', NULL, NULL, NULL),
	('890f2883-eee1-471a-b3f7-f06fc005ec72', 'Twelfth Night', 'Join us for Twelfth Night, Shakespeares beloved comedy full of mistaken identities, romance, shipwrecks, and just a hint of madness. Performed by a lively cast of local NCW talent, this homegrown evening of outdoor theatre promises laughter, mischief, and magic under the stars.', '2025-08-08', NULL, '19:30:00', NULL, '6e0b075a-c369-477d-8804-d09f175f7f99', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/events/a0SPH0000091Ix02AE', 'https://icicle.my.salesforce-sites.com/ticket/#/events/a0SPH0000091Ix02AE', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/Twelfth-Night-.jpg', false, NULL, false, true, '$15-25', 'approved', NULL, '2025-07-24 21:35:17.320341+00', '2025-07-24 21:35:17.320341+00', NULL, NULL, NULL),
