	('60d32001-d54a-475b-b2e2-27ae2ace81ad', 'Terror/Cactus & Rumbo Tumba', 'Digital folklore and psychedelic electro-cumbia project of Martn Selasco. 

Born in Buenos Aires and raised in Miami, the Seattle-based producer draws from wide variety of Latin-American influences in his productions including Argentine folk, Peruvian chicha, and Colombian cumbia. These influences are woven into hypnotic electronic beats featuring psychedelic guitars, dub lasers, and field recordings.', '2025-09-12', NULL, '19:00:00', NULL, 'fd5c956d-49c8-400a-affc-151fa31a4021', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000AEWK12AP', 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000AEWK12AP', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://images.squarespace-cdn.com/content/v1/58bb10792994ca1d9257ab1d/1621453697505-31NAO2WQN9D6TH3SACXO/TC-Studio-13.jpg?format=2500w', true, NULL, false, true, '$15-25', 'approved', NULL, '2025-07-24 21:28:52.230941+00', '2025-07-24 22:27:44.767067+00', NULL, NULL, 'Person in a white geometric-shaped mask, a hoodie, and ropes slung over one shoulder.'),
	('0c3224ad-9fb4-4853-b6d3-0c789d3bdb5a', 'Alpenglo Garden Club', 'Rachel Burgoon from Feathers and Flowers Farm from Wenatchee will be discussing what life is like as a farmer!  Come with questions about flowers, veggies, animal husbandry and farm life.', '2025-07-28', NULL, '17:00:00', '18:00:00', 'ad12dd0c-7ba3-49ff-8591-e93ea3f117ef', '618862e9-4476-4ade-8922-ff3b4c5f14db', NULL, 'https://alpengloliving.com/pages/workshops', NULL, '4105b94f-140c-4fc1-9137-deb9e99d5376', 'b93da678-d591-4abe-ab59-f38ce470bd26', NULL, 'https://cdn.shopify.com/s/files/1/0597/7764/6663/files/Screenshot_2025-06-18_at_3.16.04_PM.png?v=1750284980', false, '6fb3a9a0-55b6-44b8-991f-f363a143d31e', false, false, NULL, 'approved', NULL, '2025-07-17 00:10:08.767155+00', '2025-07-24 22:31:01.040787+00', NULL, NULL, 'small wooden greenhouse with picked flowers stacked outside'),
	('57649aaa-2436-4432-b62c-3fcc3a7f7de5', 'The Little Mermaid', 'Based on the 1989 Disney animated film, and the fairy tale by Hans Christian Andersen, a mermaid dreams of the world above the sea and gives up her voice to find true love. The magical underwater world of The Little Mermaid musical enchants audiences with beloved classics like "Part of Your World" and "Under the Sea," those timeless treasures that transport us back to our first journey beneath the waves.', '2025-08-23', NULL, '20:00:00', '22:15:00', '3e7f2a79-d5e8-4a0c-b155-072cf339ea13', 'ec374569-7a4c-4fb7-9374-1abcd6bfa620', NULL, 'https://leavenworthsummertheater.org/som', 'https://app.arts-people.com/index.php?ticketing=lvst', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://images.squarespace-cdn.com/content/v1/5f6ba16e63f3867a847921d4/2159f954-4daf-4d5c-a2ef-c9adc72b9d6c/LST+Mermaid.JPG?format=750w', false, NULL, false, true, '$14-40', 'approved', NULL, '2025-07-24 22:11:05.064257+00', '2025-07-24 22:33:32.819663+00', NULL, NULL, 'Turquoise waves with the writing Disney''s The Little Mermaid'),
	('b53ab02b-9b05-4168-8cd0-efdf5d79b734', 'Fall Fungi Field Trip', 'Join Wenatchee River Institute and Puget Sound Mycological Society for our Fall Fungi Field Trip!

