	('a7215785-44ec-413c-a012-668b09cbb38d', 'Beaded Earrings Workshop', 'Local Indigenous artist and owner of Mystic North Jewelry, Amanda Keewatinawin, will be leading a workshop on the Indigenous art form of beading including how to create your own mini beaded fringe earrings.', '2025-10-05', NULL, '12:00:00', '15:00:00', 'eb18d927-8c3e-41bd-a04a-2b748fc47588', 'cc1fdad6-0e8a-424a-be08-d169e1a50ab4', NULL, 'https://wenatcheeriverinstitute.org/programs/community/workshops.html/event/2025/10/05/mini-fringe-beaded-earring-workshop/534526?blm_aid=285554761', 'https://wenatcheeriverinstitute.org/programs/community/workshops.html/event-form/registration-form/108430/tickets', 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://cdn.firespring.com/images/d865a05c-e4de-4c19-a818-f3a702ae4bd9.jpg', false, NULL, false, true, '$75 with discounts available.', 'approved', NULL, '2025-08-21 15:38:47.870388+00', '2025-08-21 15:38:47.870388+00', NULL, NULL, 'Pair of beaded earrings with cascading bead strands in rainbow of colors.'),
	('c1f00e6f-0152-478d-aaec-1ace39127919', 'Take a Kid Mountain Biking Day', 'Take A Kid Mountain Biking Day is a public community event for families that includes riding, games, food, and more! 

Participation is free and the events are open to riders of all ages and skill levels. The more, the merrier! Bring your kids, friends, your kids'' friends, and anyone who wants to get out on the trails for a fun day of mountain biking. 

Bring helmet, bike, snacks or cash to buy food/drinks. Limited numbers of extra bikes and helmets also available.

Free tacos after riding!', '2025-10-04', NULL, NULL, NULL, '46beb7b8-6da4-4e5c-af41-6adc7a2eac06', '7bc8b593-e36e-4a0c-bf49-d4528f5f8b00', NULL, 'https://www.evergreenmtb.org/index.php?option=com_civicrm&task=civicrm/event/info&reset=1&id=3278', NULL, 'a20ee91d-6c87-46c5-92b5-869c569e6012', '96a5a760-6320-4254-9254-d8bfc892a001', NULL, 'https://www.evergreenmtb.org/images/events/2025/2025-08-22-TAKMD-Central-OCT4-001.jpg', false, NULL, false, true, NULL, 'approved', NULL, '2025-08-22 17:58:23.869429+00', '2025-08-22 17:58:23.869429+00', NULL, NULL, 'Kids in bike helmets sitting on a log'),
	('65de2edf-bd5b-4508-8f98-19e2656d7959', 'Outdoor Film: Ferris Bueller''s Day Off', 'The lassic film stars Matthew Broderick as Ferris Bueller, a popular and clever teenager who fakes being sick to enjoy a day off school. Alongside his hypochondriac best friend Cameron and girlfriend Sloane, Ferris embarks on a fun-filled escapade around Chicago, visiting landmarks like the Sears Tower, Wrigley Field, and the Art Institute of Chicago.', '2025-08-28', NULL, '20:00:00', '22:00:00', '6e0b075a-c369-477d-8804-d09f175f7f99', 'a5bc78aa-6d8c-4c19-8ee6-2fd507082c03', NULL, 'https://icicle.my.salesforce-sites.com/ticket/#/instances/a0FPH00000ACmXl2AL', NULL, 'e46ab7a2-26d1-4038-8573-e22d32c1b799', NULL, NULL, 'https://icicle.org/userfiles/FBDO-Outdoor-Movie-with-logo.jpg', false, 'cfbc5d07-0adb-4082-a69f-f0516a62516d', false, false, '$5-8', 'approved', NULL, '2025-07-24 21:24:48.190902+00', '2025-08-28 04:18:56.863404+00', NULL, NULL, 'Wayne and Garth, two men, one wearing a hat that says Waynes World.');


